import styleCss from "./style.module.css";
import React from 'react';
import { Modal } from 'react-bootstrap'
import 'bootstrap/dist/css/bootstrap.min.css';

function SignUp(props) {
    return (
        <Modal
            {...props}
            size="lg"
            aria-labelledby="contained-modal-title-vcenter"
            centered
        >
            <div>
                <form className={styleCss.form}>
                    <div className={styleCss.formGroup}>
                        <h1 className={styleCss.header}>Sign U</h1>
                        <input
                            className={styleCss.inputGroup}
                            id="fullName"
                            placeholder="Full Name"
                            type="name"
                        />

                        <input
                            className={styleCss.inputGroup1}
                            id="email"
                            placeholder="Email"
                            type="email"
                        />

                        <input
                            className={styleCss.inputGroup1}
                            id="password"
                            placeholder="Password"
                            type="password"
                        />


                        <button className={styleCss.button} >Sign In</button>
                        <p className={styleCss.text}>Don't have an account? Klik Here</p>
                    </div>
                </form>
            </div>
        </Modal>
    );
}

export default SignUp;
